    [],nt"revision_timestamp": "2016-07-27T22:57:45.359908",nt"name": "raccoon-abundance-inventory-report",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the results of a
    raccoon abundance inventory on Clarence Cannon National Wildlife Refuge in 2012.
    Determining raccoon abundance allows for consideration of a trapping program to
    limit disease transmission rates. A mark-resight study was conducted to assess raccoon
    population abundance at the Refuge. A density of 90.79 raccoons per square mile
    was estimated and this density was used to produce abundance estimates at Great
    River National Wildlife Refuge.",nt"license_title": "License Not Specified",nt"extras":
